  false,\n\t\"url\": null,\n\t\"notes\": \"Rainbow trout and steelhead consist of
  the same species and often inhabit the similar habitat types within the same watershed.
  Although their life histories differ from one another, there is thought to be genetic
  introgression between types. This study seeks to undertake genetic characterization
  of resident rainbow populations prior to reintroduction of steelhead in the Lewis
  River.nnLewis River rainbow trout genetics.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
